          </ul>
        </div>
      </nav>

      <div className='QuesCard'>
        <div className = "SingleCard">
          <QuesBank id = "Question 1" ques = "Question" ans = "Answer" comp = "Company"/>
        </div>
      </div>

    </>
  );
}

export default App;
